      <section className="section" style={{
        padding: "40px 20px",
        backgroundColor: "#f9f9f9"
      }}>
        <h2 className="section-title" style={{
          fontSize: "30px",
          color: "#3b3b3b",
          textTransform: "uppercase",
          textAlign: "center",
          fontWeight: "bold",
          marginBottom: "20px"
